        new NaturezaReceita(){Id = 1099, Exercicio = 2021, C = "1", O = "3", E = "4", D1 = "1", DD2 = "04", D3 = "1", T = "0", NR = "13410410", Especificacao = "Participação Especial pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão", Descriciao = "Agrega as receitas auferidas a título de participação especial pela produção de petróleo, gás natural ou outros hidrocarbonetos fluidos em campos explorados sob regime de concessão, quando a lavra ocorrer em terra. O art. 50 da Lei no 9.478, de 6 de agosto de 1997, determina que “o edital e o contrato estabelecerão que, nos casos de grande volume de produção, ou de grande rentabilidade, haverá o pagamento de uma participação especial [...]”. Conforme dispõe o § 1o do referido art. 50, “a participação especial será aplicada sobre a receita bruta da produção, deduzidos os royalties, os investimentos na exploração, os custos operacionais, a depreciação e os tributos previstos na legislação em vigor”.", NormaCorrespondente = null, Valorizavel = "NÃO"},
