        new NaturezaReceita(){Id = 1117, Exercicio = 2021, C = "1", O = "3", E = "4", D1 = "1", DD2 = "04", D3 = "3", T = "0", NR = "13410430", Especificacao = "Participação Especial pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Demais Situações", Descriciao = "Agrega as receitas auferidas a título de participação especial pela produção de petróleo, gás natural ou outros hidrocarbonetos fluidos em campos explorados sob regime de concessão, quando a lavra ocorrer na plataforma continental, no mar territorial ou na zona econômica exclusiva, em contratos cuja declaração de comercialidade tenha ocorrido antes de 3/12/2012, fora do horizonte geológico* e das áreas do pré-sal** e estratégicas. O art. 50 da Lei no 9.478, de 6 de agosto de 1997, determina que “o edital e o contrato estabelecerão que, nos casos de grande volume de produção, ou de grande rentabilidade, haverá o pagamento de uma participação especial [...]”. Conforme dispõe o § 1o do referido art. 50, “a participação especial será aplicada sobre a receita bruta da produção, deduzidos os royalties, os investimentos na exploração, os custos operacionais, a depreciação e os tributos previstos na legislação em vigor”. * Entende-se por horizonte geológico denominado Pré-Sal o intervalo de rochas que se estende por baixo de uma extensa camada de sal, localizado em áreas de águas profundas, em grande parte do litoral brasileiro. **A área do pré-sal é definida pelo inciso IV do art. 2o da Lei no 12.351, de 22 de dezembro de 2010, como a “região do subsolo formada por um prisma vertical de profundidade indeterminada, com superfície poligonal definida pelas coordenadas geográficas de seus vértices estabelecidas no Anexo desta Lei, bem como outras regiões que venham a ser delimitadas em ato do Poder Executivo, de acordo com a evolução do conhecimento geológico”.", NormaCorrespondente = null, Valorizavel = "NÃO"},
