        new NaturezaReceita(){Id = 4692, Exercicio = 2021, C = "2", O = "3", E = "0", D1 = "0", DD2 = "02", D3 = "0", T = "0", NR = "23000200", Especificacao = "Amortização Proveniente da Execução de Garantia - Operações de Crédito", Descriciao = "Agrega os recursos oriundos da retenção de receitas próprias de Estados e Municípios em função do não-pagamento de dívidas nas quais a União foi garantidora. A legislação aplicável à honra de aval concedido pela União em operações de crédito externas é o Decreto-Lei nº 1.928, de 18 de fevereiro de 1982, alterado pelo Decreto-Lei nº 2.169, de 29 de outubro de 1984. Com relação à honra de aval interna, aplica-se a Lei Complementar nº 101, de 5 maio de 2000 . Quando o devedor original, por qualquer razão, não efetua o pagamento de sua dívida, a União, como garantidora, realiza o pagamento da prestação em atraso, sub-rogando-se no crédito respectivo junto ao devedor.", NormaCorrespondente = null, Valorizavel = "NÃO"},
